tables.table_schema:
CREATE TABLE chatbot_users (
    user_id INT PRIMARY KEY,
    username VARCHAR(50) NOT NULL,
    first_name VARCHAR(50) NOT NULL,
    last_name VARCHAR(50) NOT NULL
);

CREATE TABLE users (
    id INT PRIMARY KEY,
    name TEXT,
    age INT,
    email TEXT
);

CREATE TABLE bots (
    id INT PRIMARY KEY,
    name TEXT,
    description TEXT
);

CREATE TABLE users (
  user_id UUID PRIMARY KEY,
  user_name TEXT,
  email TEXT
);

CREATE TABLE agents (
  agent_id UUID PRIMARY KEY,
  agent_name TEXT,
  status TEXT
);

CREATE TABLE bot_responses (
    response_id SERIAL PRIMARY KEY,
    user_id INT,
    response TEXT,
    timestamp TIMESTAMP
);

CREATE TABLE user_feedback (
    feedback_id SERIAL PRIMARY KEY,
    user_id INT,
    feedback TEXT,
    timestamp TIMESTAMP
);
